import React from 'react';
import {Container, Row, Col} from "react-bootstrap";
const Footer = () => {
  const currentYear = new Date().getFullYear()
  return (
    <footer>
      <Container>
        <Row>
          <Col className='text-center py-3'></Col>
          <p>VROOM &copy; {currentYear}</p>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
